import { types } from "mobx-state-tree";
const inf=types.model({
    id:types.number,
    img:types.string
})
const listin=types.model({
    list:types.optional(types.array({inf}),[])
}).actions( (self) => {
    function addTodo(inf){
        self.list.push(inf)
    }
    
    return {
        addTodo
    }
})
export const listinf=listin.create()
